import React, {Component} from 'react';

class Card extends Component{
    render(){
        return(
            <React.Fragment>
                <section className="card-container">
                    <header className="card-header">
                        <span initials="JS"></span>
                        <h2>Jane Smith</h2>
                    </header>

                    <main>
                        <ul>
                            <li><span>Birthday</span><p>Jan 1, 1980</p></li>
                            <li><span>Address</span><p>123 Fulton St.</p></li>
                            <li><span>Phone</span><p>212-234-5678</p></li>
                        </ul>
                    </main>
                </section>
            </React.Fragment>
        )
    }
}

export default Card;
